import React from 'react';
import { Link } from 'react-router-dom';

export const Mypage = () => {

  return (
    <div style={{ display: 'flex', alignItems: 'center' }}>
      
      {/* 사이드바 */}
      <div style={{ width: '20%', height: '100vh', backgroundColor: '#f0f0f0', padding: '20px' }}>
        {/* 여기에 사이드바 내용을 추가하세요 */}
        <ul style={{ listStyleType: 'none', padding: 0 }}>
          <li style={{ marginBottom: '10px' }}>
            <Link to="/mypage" style={{ textDecoration: 'none', color: '#333' }}>회원 정보</Link>
          </li>
          {/* 다른 사이드바 항목들도 추가하세요 */}
        </ul>
      </div>

      {/* 회원 정보 폼 */}
      <div style={{ flex: 1, marginLeft: '20px' }}>
        <div style={{ margin: '40px' }}>
          <h2 style={{ color: '#333', fontWeight: 'bold', fontSize: '1.5rem' }}>회원 정보</h2>
        </div>

        {/* 회원 정보 입력 폼 */}
        <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'baseline' }}>
          {/* 입력 폼 내용 */}
        </div>

        {/* 버튼 */}
        <div>
          <Link to="/mypage">
            <button className="btn btn-outline" style={{ marginRight: '10px' }}>회원정보 수정</button>
          </Link>
          <Link to="/mypage">
            <button className="btn btn-outline">회원정보 탈퇴</button>
          </Link>
        </div>
      </div>

    </div>
  );
};

export default Mypage;
